let _markdown = "\n\nChangelog [#changelog]\n\nAll notable changes to LinkDen are documented here. For the full commit history, see the [GitHub repository](https://github.com/mrdemonwolf/linkden/commits/main).\n\n***\n\nv0.1.0 -- Initial Release [#v010----initial-release]\n\n**February 2026**\n\nThe first public release of LinkDen.\n\nCore Platform [#core-platform]\n\n* **Block builder** with drag-and-drop reordering and live phone preview\n* **5 block types**: Link, Header, Social Icons, Embed, Contact Form\n* **100+ social brands** from Simple Icons\n* **7 built-in themes** with dark and light variants (14 total)\n* **Setup wizard** -- 4-step onboarding (Account, Profile, Theme, Done)\n\nAdmin Panel [#admin-panel]\n\n* Dashboard with stat cards (views, clicks, unread contacts) and mini bar chart\n* Block builder with slide-in edit panel (Content, Style, Options, Schedule tabs)\n* Social network management page with search and toggle\n* Full analytics dashboard with period selector, charts, top links, referrers, countries\n* Contact form submissions management with read/unread tracking\n* Settings page with 11 configuration sections\n* Version update checker\n\nFeatures [#features]\n\n* **Better Auth** email/password authentication\n* **Apple Wallet** pass configuration\n* **vCard** generation and download (VCard 3.0)\n* **Contact form** with Cloudflare Turnstile and Google reCAPTCHA support\n* **Email notifications** via Resend or Cloudflare Email Workers\n* **Analytics** -- page views, link clicks, referrers, country breakdown (privacy-friendly)\n* **Block scheduling** with start/end dates\n* **Color customization** with CSS custom properties\n* **Custom CSS** injection\n* **SEO** -- dynamic sitemap, robots.txt, Open Graph meta tags\n* **Export/Import** data as JSON (merge or replace modes)\n* **Whitelabel** branding with custom footer\n\nInfrastructure [#infrastructure]\n\n* **Cloudflare Workers** API server with Hono + tRPC v11\n* **Cloudflare D1** (SQLite) database with Drizzle ORM\n* **Next.js 16** frontend with React 19 and Tailwind CSS v4\n* **Turborepo** monorepo with shared packages (api, auth, db, env, ui, validators, email)\n* **Better Auth** session-based authentication\n* **Alchemy** infrastructure-as-code for Cloudflare deployment\n* **Docker** support for self-hosting\n";
